resources.description:
Zasób zawiera mapowanie słupków przystankowych występujących niezależnie w bazie danych TRISTAR użytkowanej przez ZTM w Gdańsku i ZKM Gdynia.

Opis kolumn w załączonym pliku:

+	ID – unikalny nr wiersza;
+	__name__ – wspólna nazwa przystanku – tak, aby z punktu widzenia pasażera słupek przystankowy był widoczny jako jeden – czyli tak, jak jest to w rzeczywistości;
+	__main gmv short name__ – odpowiednik pola “stopShortName” z zasobu [__Lista przystanków__](https://ckan.multimediagdansk.pl/dataset/tristar/resource/4c4025f0-01bf-41f7-a39f-d156d201b82b)
+	__main organization id__ – nr organizatora (ZTM w Gdańsku zostało przypisane ID wynoszące 1; a ZKM Gdynia ID równe 2); 
+	__mapped gmv short name__ - odpowiednik pola “stopShortName” z zasobu [__Lista przystanków__](https://ckan.multimediagdansk.pl/dataset/tristar/resource/4c4025f0-01bf-41f7-a39f-d156d201b82b); 
+	__mapped organization id__ – nr organizatora (ZTM w Gdańsku zostało przypisane ID wynoszące 1; a ZKM Gdynia ID równe 2);
+	__nr stanowiska__ – nr słupka w ramach grupy przystanków, odpowiednik pola “stopCode” z zasobu [__Lista przystanków__](https://ckan.multimediagdansk.pl/dataset/tristar/resource/4c4025f0-01bf-41f7-a39f-d156d201b82b). 
               
Krótkie wyjaśnienie do powyższego:

+	jeśli "main organization id"=1, to main_gmv_short_name należy szukać wśród słupków ZTM w Gdańsku (tj. pole "stopId" w zasobie [__Lista przystanków__](https://ckan.multimediagdansk.pl/dataset/tristar/resource/4c4025f0-01bf-41f7-a39f-d156d201b82b);
+	jeśli "mapped organization id"=2, to "mapped gmv short name" należy szukać wśród słupków ZKM Gdynia (tj. pole "stopId" w zasobie [__Lista przystanków__](https://ckan.multimediagdansk.pl/dataset/tristar/resource/4c4025f0-01bf-41f7-a39f-d156d201b82b) powyżej 30000). 

Plik jest aktualny na dzień: 2019-06-05.

Plik zawiera kolumny: Rok, Odpady wytworzone w ciągu roku w tys. t przekazane innym odbiorcom, Odpady wytworzone w ciągu roku w tys. t poddane odzyskowi	, Odpady wytworzone w ciągu roku w tys. t unieszkodliwione nieskładowane, Odpady wytworzone w ciągu roku w tys. t składowane, Odpady wytworzone w ciągu roku w tys. t magazynowane czasowo

Zmiana od 2014 r.; od tego czasu istnieje możliwość przekazania odpadów innym podmiotom;		
Źródło: Opracowanie własne RBiASG, WPG, UMG na podstawie Informatorów o sytuacji społeczno-gospodarczej Gdańska

